import React from 'react';
import Axios from 'axios';

class ProjectforDev extends React.Component{
    constructor(props){
        super(props);
        this.state={data:null};
        Axios.get(`http://localhost:3002/${this.props.match.params.proid}`)
    }
}
export default ProjectforDev;
